import React from 'react';
import web from './images/img1.svg';
import { NavLink } from 'react-router-dom';
import Common from './Common';
const Home = ()=>{
    return (
        <>
        <Common name="Grow your business with" imgsrc={web} visit="/about" btname="Get Started"  />
        </>
    );
};
export default Home;
